// src/pages/estoque/EstoqueList.js

import React, { useState, useEffect } from "react";

function EstoqueList() {
  const [estoque, setEstoque] = useState([]);

  useEffect(() => {
    fetch("http://localhost:8080/estoque")
      .then((res) => {
        if (!res.ok) {
          throw new Error("Falha ao buscar o estoque");
        }
        return res.json();
      })
      .then((data) => {
        console.log("Estoque recebido:", data);
        setEstoque(data);
      })
      .catch((error) => {
        console.error("Erro ao listar estoque:", error);
      });
  }, []);

  return (
    <div>
      <h2>Lista de Estoque</h2>
      <table border="1" cellPadding="5">
        <thead>
          <tr>
            <th>ID Estoque</th>
            <th>Tipo Sangu√≠neo</th>
            <th>Quantidade de Bolsas</th>
          </tr>
        </thead>
        <tbody>
          {estoque.map((item) => (
            <tr key={item.idEstoque}>
              <td>{item.idEstoque}</td>
              <td>{item.tipoSanguineo}</td>
              <td>{item.qtdBolsas}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default EstoqueList;
